import React, { useEffect } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import StoreLogin from "../../components/StoreLogin";
import StoreRegister from "../../components/StoreRegister";
// import StoreProductImage from "../../components/StoreProductImage";
// import StoreProductDescription from "../../components/StoreProductDescription";
import "./store_user.css";

const StoreDetails = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <BrowserRouter>
      <Routes>
        <main className="store__login store__container">
          <Route path="*" element={<StoreLogin />} />
          <Route path="*" element={<StoreRegister />} />
        </main>
      </Routes>
    </BrowserRouter>
  );
};

export default StoreDetails;
